import axios from "axios";
import react,{ useEffect,useState } from "react";
import { useParams } from "react-router-dom";
import personajes from "./PersonajesPages";
import "./PersonajeDetailPage.scss"
const PersonajeDetail = () => {
    const urlPersonajeDetail = 'https://api.got.show/api/show/characters'
    const [PersonajeDetail, setPersonajeDetail] = useState ({});
    let {id} = useParams();
    useEffect (() => {
        const getPersonajeDetail = async () =>{
            const res = await axios.get (urlPersonajeDetail+'/'+id)
            setPersonajeDetail(res.data)

        }
        getPersonajeDetail()
    },[])
    console.log(PersonajeDetail)
    return (<div className="personajesdetail">
        <img src={PersonajeDetail.image} alt={PersonajeDetail.image}/>
    <div >{PersonajeDetail.name}</div> 
    <p>House</p>
    
    <img src={PersonajeDetail.logoURL} alt={PersonajeDetail.logoURL}/>
    <p>Allegiances</p>
        <div >{PersonajeDetail.allegiances}</div> 
        <p>Appearances</p>
        <div >{PersonajeDetail.appearances}</div> 
        <p>Father</p>
        <div >{PersonajeDetail.father}</div> 
        <p>Familie</p>
        <div >{PersonajeDetail.siblings}</div> 
        <p>Titles</p>
        <div >{PersonajeDetail.titles}</div> 
        


    </div>)
}





export default PersonajeDetail
